import { Navigate } from "react-router-dom"
import { useAuth } from "./Auth"

let RequireAuth = ({children}) => {
    let Auth = useAuth()

    if (!Auth.user) {
        return <Navigate to="login" />
    }

    return {children}
}

export default RequireAuth
